--[[
 BEFORE USING A MACRO IN RUST, YOU NEED TO SET THE CORRECT GAME SETTINGS. 
 OPEN THE GAME CONSOLE (F1 KEY) AND ENTER THE FOLLOWING THREE COMMANDS:

	IF THE LOW SENSETIVITY SUPPORT IS TURNED OFF:
		VARIANT #1:                    	VARIANT #2:
		 input.sensitivity 1.0       	 input.sensitivity 0.8333
		 input.ads_sensitivity 0.8333    input.ads_sensitivity 0.8333
		 fov 75                      	 fov 90

	IF THE LOW SENSETIVITY SUPPORT IS TURNED ON:
		VARIANT #3:                    	VARIANT #4:
		 input.sensitivity 0.5       	 input.sensitivity 0.416666
		 input.ads_sensitivity 0.8333    input.ads_sensitivity 0.8333
		 fov 75                      	 fov 90
______________________________________________________________________________________________

 FOR THE CORRECT WORK OF SEMI-AUTOMATIC WEAPONS - GO TO THE INGAME SETTINGS, "CONTROLS" TAB
 AND SET THE ADDITIONAL ATTACK KEY ("PRIMARY ATTACK") TO THE "PAUSE/BREAK" KEY.
______________________________________________________________________________________________

 FOR CORRECT WORK OF THE SCRIPT — DON'T FORGET TO SET MOUSE KEYBINDS.
 YOU CAN DO THIS BY REPLACING "NIL" TO THE ID OF THE DESIRED MOUSE BUTTON.

					DEFAULT SUPPORTED MOUSE BUTTON'S IDS:
					   5 (UPPER SIDE MOUSE BUTTON)
					   4 (LOWER SIDE MOUSE BUTTON)
					   6 (DPI CHANGE BUTTON)

  EXAMPLE: local AK47 — 5
______________________________________________________________________________________________

 AFTER ANY CHANGES - SAVE THE SCRIPT (CTRL+S)
 VIDEO-INSTRUCTION: https://youtu.be/GJ3CLt5o0Kk
______________________________________________________________________________________________
]]

